"""
128. Longest Consecutive Sequence
https://leetcode.com/problems/longest-consecutive-sequence/description/?envType=problem-list-v2&envId=hash-table
"""

"""
Given an unsorted array of integers nums, return the length of the longest consecutive elements sequence.

You must write an algorithm that runs in O(n) time.

It is possible to turn array into set and then just check range, but i need to be able to test every
possible sequence.

Apperantly my solution is at worst O(n^2) cuz of counting in cycle. Will do another method: 
try making map with all possible sequenses.

Or better idea: append tmp set with numbers and each number i add i will check if summ is calculated
using (min(set) + max(set) / 2) * len(set)

It turns out that min(set) is O(n) operation, wasted a lot of time for wrong solution


Very new concept for me, lessen learned: i can check in both + and - directions and more than that
edge cases can be done separatly: they are not fucking importaint
"""

class Solution:
    def longestConsecutive(self, nums: list[int]) -> int:
        set_nums = set(nums)
        max_len = 1
        curr_len = 1
        if len(set_nums) == 1:
            return 1
        if len(set_nums) == 0:
            return 0
        for num in set_nums:
            strike_number = num
            if  (strike_number - 1) in set_nums:
                pass
                # set_nums.remove(strike_number)                    
            else:
                # set_nums.remove(strike_number)
                while (strike_number + 1) in set_nums:
                    # set_nums.remove(strike_number + 1)
                    curr_len += 1
                    strike_number += 1



                if curr_len > max_len:
                    max_len = curr_len 
                curr_len = 1
                # strike_number = 0
        return max_len

